import TopDownCameraController from "../model/engine/input/ecs/components/TopDownCameraController.js";
import { Camera } from "../model/graphics/ecs/camera/Camera.js";
import EntityBuilder from "../model/engine/ecs/EntityBuilder.js";
import { Light } from "../model/graphics/ecs/light/Light.js";
import Vector3 from "../model/core/geom/Vector3.js";
import Terrain from "../model/level/terrain/ecs/Terrain.js";
import Vector2 from "../model/core/geom/Vector2.js";
import Water from "../model/graphics/ecs/water/Water.js";
import InputController from "../model/engine/input/ecs/components/InputController.js";
import { decodeMouseEventButtons } from "../model/engine/input/devices/PointerDevice.js";
import { initializeSystems } from "./GameSystems.js";

/**
 *
 * @param {Engine} engine
 * @returns {Promise}
 */
function setLocale(engine) {
    function getURLHash() {
        const result = {};

        if (window === undefined) {
            return result;
        }

        const location = window.location;

        const hash = location.hash;

        const hashRegEx = /([a-zA-Z0-9\-\_]+)\=([a-zA-Z0-9\-\_]+)/g;

        let match;
        while ((match = hashRegEx.exec(hash)) !== null) {
            const variableName = match[1];
            const value = match[2];

            result[variableName] = value;
        }

        return result;
    }

    const urlHash = getURLHash();

    let locale;
    if (urlHash.lang !== undefined) {
        locale = urlHash.lang;
    } else {
        locale = 'en-gb';
    }

    return engine.localization.loadLocale(locale);
}

const GRASS_TEXTURE_URL = "data:image/jpeg;base64,";

const NOISE_256_URL = "data:image/png;base64,";

export class EngineHarness {
    constructor() {
        /**
         *
         * @type {Engine}
         */
        this.engine = new Engine();

        window.engine = this.engine;

        this.p = null;
    }

    /**
     *
     * @returns {Promise<Engine>}
     */
    initialize() {

        if (this.p !== null) {
            return this.p;
        }


        const engine = this.engine;

        //Register game systems
        initializeSystems(engine, engine.entityManager, engine.graphics, engine.sound, engine.assetManager, engine.grid, engine.devices);

        const promise = new Promise(async function (resolve, reject) {
            await engine.start();

            engine.sceneManager.create('test');
            engine.sceneManager.set('test');


            document.body.appendChild(engine.viewStack.el);
            engine.viewStack.link();

            function handleInput() {
                window.removeEventListener(MouseEvents.Down, handleInput);

                engine.sound.resumeContext();
            }

            window.addEventListener(MouseEvents.Down, handleInput);

            resolve(engine);
        });

        this.p = promise;

        return promise;
    }

    /**
     *
     * @param {Engine} engine
     * @param {Vector3} [target]
     * @param {number} [distance]
     * @param {number} [pitch]
     * @param {number} [yaw]
     * @returns {EntityBuilder}
     */
    static buildCamera(
        {
            engine,
            target = new Vector3(),
            distance = 10,
            pitch = -1.4,
            yaw = 0
        }
    ) {
        const transform = new Transform();

        const cameraController = new TopDownCameraController();
        cameraController.pitch = pitch;
        cameraController.yaw = yaw;
        cameraController.distance = distance;
        cameraController.distanceMin = 0;
        cameraController.distanceMax = 1000;
        cameraController.target.copy(target);

        const camera = new Camera();

        camera.active.set(true);
        camera.autoClip = false;

        const entityBuilder = new EntityBuilder();

        entityBuilder
            .add(transform)
            .add(cameraController)
            .add(camera)
            .build(engine.entityManager.dataset);

        console.log('build camera', entityBuilder);

        return entityBuilder;
    }


    /**
     *
     * @param {Engine} engine
     */
    static buildLights(engine) {
        const light = new Light();
        light.type.set(Light.Type.DIRECTION);
        light.color.setRGB(1, 1, 1);
        light.intensity.set(1.1);
        light.castShadow.set(true);

        const transform = new Transform();
        transform.position.set(30, 70, 30);
        transform.rotation.set(
            -0.18780341950959473,
            0.8049745556929917,
            -0.4533975611897181,
            -0.3334313787830773
        );

        new EntityBuilder()
            .add(light)
            .add(transform)
            .build(engine.entityManager.dataset);
    }

    /**
     *
     * @param {number} cameraEntity
     * @param {Engine} engine
     * @param {number} [sensitivity]
     * @param {Element} domElement
     * @returns {EntityBuilder}
     */
    static buildOrbitalCameraController({ cameraEntity, engine, sensitivity = 0.01 }) {
        const ecd = engine.entityManager.dataset;

        const domElement = engine.graphics.domElement;

        const cameraController = ecd.getComponent(cameraEntity, TopDownCameraController);

        const camera = ecd.getComponent(cameraEntity, Camera);

        /**
         *
         * @param {Vector2} delta
         */
        function orbit(delta) {

            cameraController.yaw += delta.x * sensitivity;
            cameraController.pitch += delta.y * sensitivity;
        }

        /**
         *
         * @param {Vector2} delta
         */
        function pan(delta) {
            const d = delta.clone();

            TopDownCameraController.pan(d, camera.object, domElement, cameraController.distance, camera.object.fov, cameraController.target);

        }

        domElement.addEventListener('contextmenu', (event) => {
            event.preventDefault();
        });

        const inputController = new InputController([
            {
                path: 'pointer/on/tap',
                listener(position, event) {
                    event.preventDefault();
                }
            },
            {
                path: 'pointer/on/down',
                listener(position, event) {
                    event.preventDefault();
                }
            },
            {
                path: 'pointer/on/drag',
                listener: function (position, origin, lastDragPosition, event) {
                    const delta = lastDragPosition.clone().sub(position);

                    const buttons = decodeMouseEventButtons(event.buttons);

                    if (buttons[0]) {
                        pan(delta);
                    } else {
                        orbit(delta);
                    }

                    event.preventDefault();
                }
            },
            {
                path: 'pointer/on/wheel',
                listener(delta, event) {
                    cameraController.distance += delta.y;
                }
            }
        ]);

        const eb = new EntityBuilder();
        eb.add(inputController);

        eb.build(ecd);

        return eb;
    }


    /**
     *
     * @param {Engine} engine
     * @param {Vector2} [size]
     * @param {String} [diffuse0]
     * @param heightMap
     * @param heightRange
     * @param resolution
     * @param waterLevel
     * @returns {Terrain}
     */
    static buildTerrain(
        {
            engine,
            size = new Vector2(10, 10),
            diffuse0 = GRASS_TEXTURE_URL,
            heightMap = NOISE_256_URL,
            heightRange = 0,
            resolution = 10,
            waterLevel = 0
        }
    ) {

        const terrainSystem = engine.entityManager.getSystemByComponentClass(Terrain);

        const terrain = new Terrain();
        terrain.fromJSON({
            heightMapRange: heightRange,
            resolution: resolution,
            size: {
                x: size.x,
                y: size.y
            },
            scale: 2,
            material: {
                "type": "splat",
                "repeat": {
                    "x": 1,
                    "y": 1
                },
                "textures": {
                    "splat": ["data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAIAAACQd1PeAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAB3RJTUUH3gofFy0Wa73S3AAAAB1pVFh0Q29tbWVudAAAAAAAQ3JlYXRlZCB3aXRoIEdJTVBkLmUHAAAADElEQVQI12P4//8/AAX+Av7czFnnAAAAAElFTkSuQmCC"],
                    "diffuse": [diffuse0]
                }
            },
            "heightMap": heightMap,
        }, terrainSystem);

        const water = new Water();

        water.level.set(waterLevel);

        new EntityBuilder().add(terrain).add(water).build(engine.entityManager.dataset);

        return terrain;

    }
}

let singleton = null;

/**
 *
 * @returns {EngineHarness}
 */
EngineHarness.getSingleton = function () {
    if (singleton === null) {
        singleton = new EngineHarness();
    }

    return singleton;
};

